import React from 'react'


const Items = (props) => {
  return (
    <>
        <div className='menu-items'>
                 {props.list.map((curelem)=>{
                  const { id, name, category, image, price, description} = curelem
                       return(
                        <div className='items'>
                        <div className='image'>
                          <img  src={image}  alt='image' height="100%"/>
                          </div>
                          <div className=' details'>
                            <h2>{name}</h2>
                            <p>{description}</p>
                           <p> <span>{price}</span> <button>Order Now</button> </p>
                           <p>price may vary as selected dish </p>
                          </div>
                        </div>
                       )
                 })}  
        </div>
    </>
  )
}

export default Items
